import React, { useState, useEffect } from "react";
import axios from "axios";

const RoundsDisplay = ({ eventId }) => {
  const [rounds, setRounds] = useState([]);

  const fetchRounds = async () => {
    const fetchRounds = async () => {
  try {
    const response = await axios.get(
      `http://localhost:3000/event-admin/get-rounds/${eventId}`
    );
    const roundsData = response.data;
    console.log("Fetched rounds data:", roundsData);

    const processedRounds = roundsData.map((round) => {
      const processedHeats = (round.heats || []).map((heat) => {
        const processedCompetitors = (heat.competitors || []).map(
          (competitor) => ({
            id: competitor.id,
            name: competitor.name,
          })
        );
        console.log("Processed competitors for heat:", heat.id, processedCompetitors);
        return {
          id: heat.id,
          name: heat.heat_name,
          competitors: processedCompetitors,
        };
      });
      console.log("Processed heats for round:", round.id, processedHeats);
      return {
        id: round.id,
        name: round.round_name,
        category: round.category,
        sub_category: round.sub_category,
        board_type: round.board_type,
        gender: round.gender,
        age_category: round.age_category,
        heats: processedHeats,
      };
    });

    console.log("Processed rounds:", processedRounds);
    setRounds(processedRounds);
  } catch (error) {
    console.error("Error fetching rounds:", error);
  }
